	 ('A','CAVEAT_MSG','A','For up-to-the minute office hours and available physicians, please call the Health Net Coordinator at <coordinators phone number>.',1,'N',TIMESTAMP'2000-01-01 00:00:00',TIMESTAMP'4000-01-01 00:00:00',NULL,1),
	 ('D','CAVEAT_MSG','D','<Parents name> is an Independent Physicians Association (IPA) consisting of Primary Care Physicians specializing in family practice, general practice, internal medicine, pediatrics and obstetrics and gynecology.  Specialist physicians such as Allergists, Dermatologists, Cardiologists, etc., are also members of the IPA. Upon enrollment, you will select a Primary Care Physician who will manage your care.  However, before seeing a physician, you must contact your Health Net Coordinator to enroll with the physician of your choice.  New physicians may have been added and listed physicians may no longer be accepting patients, or may be accepting current patients only. For up-to-the-minute physician availability, please call the Administrative Office at <parents phone number>.',1,'N',TIMESTAMP'2000-01-01 00:00:00',TIMESTAMP'4000-01-01 00:00:00',NULL,1),
	 ('M','CAVEAT_MSG','M','Affiliate offices are indicated above.  While services may be provided at the affiliate location, your Health Net identification card will indicate your enrollment in the primary location. Your Primary Care Physician may find it necessary to refer you for specialty services to other locations within the <parents name> network of contracting physicians. Upon enrollment, you must select a Primary Care Physician who will manage your care.  However, before seeing a physician, you must contact the <parents name> HMO Office at (415) 725-8017 to enroll with the physician of your choice.  New physicians may have been added and listed physicians may no longer be accepting patients, or may be accepting current patients only. For current office hours and available physicians, please call the Health Net Coordinator at <coordinators phone number>',1,'N',TIMESTAMP'2000-01-01 00:00:00',TIMESTAMP'4000-01-01 00:00:00',NULL,1),
	 ('Y','CAVEAT_MSG','Y','<Parents name> is one of three regional Independent Physici Associations (IPAs) which form the Bay Physicians Medical Gr Enrollment in <parents name> will provide you with access t primary and specialty healthcare services, and the broader B Physicians Medical Group panel as deemed appropriate by you Care Physician, and authorized by your medical group. Upon enrollment you must select a Primary Care Physician who manage your medical care.  For up-to-the minute physician av please call the Administrative Office at <parents phone num',1,'N',TIMESTAMP'2000-01-01 00:00:00',TIMESTAMP'4000-01-01 00:00:00',NULL,1),
